import React from 'react';
import { Overview } from './views/Overview';
import { ArticulosContext, ArticulosTienda } from './hooks/ArticulosTienda';
import { Global } from '@emotion/react';

function App() {
 const articulos = ArticulosTienda();
  return (
    <ArticulosContext.Provider value={{articulos}}>

      <Router>
        <Switch>
          <Route path="/" component={GlobalRouter} />
        </Switch>
      </Router>

    </ArticulosContext.Provider>
  );
};

export default App;
